import React, {useState} from 'react';
import * as cal from './Heading.jsx';
import contact from './contacts.js'
import './index.css'

function App() {
  var time =  new Date().getHours();
    var greeting;
    var [numberz, setNumber] = useState(new Date())
    const [entername, setName] = useState({
      Name : "",
      SurName : ""
    });
    
    var sitai = {
    color: "yellow",
    fontSize: "20px",
    }
    setInterval ( () => {setNumber(numberz = new Date())});
    if (time >= 0 && time < 12){
        greeting = "Good morning, ";
        sitai.color = "red";
    } else if (time >= 12 && time < 18){
        greeting = "Good afternoon, ";
        sitai.color = "blue";
    } else {
        greeting = "Good evening, ";
        sitai.color = "green";
    }
    function Whenypein (event) {
       const {value, name} = event.target;
       setName((prevValue) => {
           if(name == "Namez") {
             return {
               Name: value,
               Surname: prevValue.SurName
             };
           }
           else if(name == "SurName") {
             return {
               Name: prevValue.Name,
               Surname: value
             };
           }
         } 
       )
    }
    return (
    <div>
      <h1 style = {sitai}>{greeting} {entername.Name} {entername.SurName}</h1>
      <input onChange = {Whenypein} name = "Namez" placeholder = "YourName" value = {entername.Name}/>
      <input onChange = {Whenypein} name = "SurName" placeholder = "Surname" value = {entername.SurName}/>
     </div> )
    function Welcome(){
    return contact.map( contact => 
      <cal.default 
      key = {contact.id}
      id = {contact.id}
      name = {contact.name}
      tel = {contact.tel}
      email = {contact.email}
      />)
    }
}
export default App;
